import logo from './logo.svg';
import './App.css';
import Header from "./header.js"
import Places from "./places.js"
import { BrowserRouter, Route, Redirect, Switch } from "react-router-dom";

function App() {
  return(
 <>
 <BrowserRouter>
  <Header/>

  <Switch>

  <Route path="/attractions/:id">
    <Header/>
  </Route>

</Switch>

 </BrowserRouter>,
 </>
  );
}

export default App;
